import React from 'react'
import AppBar from '@material-ui/core/AppBar'
import Toolbar from '@material-ui/core/Toolbar'
import IconButton from '@material-ui/core/IconButton'
import useMediaQuery from '@material-ui/core/useMediaQuery'
import Button from '@material-ui/core/Button'
import makeStyles from '@material-ui/core/styles/makeStyles'
import { useTheme } from '@material-ui/styles'
import { GlobalContext } from '../../ContextApi'
import { useHistory } from 'react-router'
import Menu from '@material-ui/core/Menu'
import MenuItem from '@material-ui/core/MenuItem'

import Brightness3Icon from '@material-ui/icons/Brightness3';
import WbSunnyIcon from '@material-ui/icons/WbSunny';
import ExitToAppIcon from '@material-ui/icons/ExitToApp';
import ArchiveIcon from '@material-ui/icons/Archive';
import EditIcon from '@material-ui/icons/Edit';

import MobileView from './MobileView'
import NavLinks from './NavLinks'


const useStyles = makeStyles(theme => ({
  root: {
    borderBottom: '2px solid silver',

    '& .MuiToolbar-root': {
      display: 'flex'
    },
  },
  leftMenu: {
      flexGrow: 1
    }
}))



const EditMenu = ({openMenu, setOpenMenu, ...others}) => {
  console.log("open", openMenu)
  return (
    <Menu
      open={openMenu}
      onClose={() => setOpenMenu(false)}
    >
      <MenuItem>Item1</MenuItem>
    </Menu>
  )
}



function Header() {
  const[openMenu, setOpenMenu] = React.useState(false)
  const classes = useStyles()
  const {darkMode, setDarkMode, loggedIn, setLoggedIn} = GlobalContext()
  const theme = useTheme()
  const view = useMediaQuery(theme.breakpoints.down('xs'))
  const history = useHistory()

  const handleLogout = (e) => {
    e.preventDefault()
    localStorage.setItem('access_token', null)
    localStorage.setItem('refresh_token', null)
    setLoggedIn(false)

  }
  console.log(openMenu)
  return (
    <AppBar 
      position={view ? "fixed": "sticky"}
      className={classes.root}
      color="inherit"
      id="appBar"
      >
      <Toolbar 
        variant="dense"
        >
        <div 
          className={classes.leftMenu}
          > 
          {view
            ? <MobileView />
            : <NavLinks />
          }
        </div>
        <div >
          <IconButton
            color="primary"  
          >
            <ArchiveIcon />
          </IconButton>
          <IconButton
           onClick={()=>setDarkMode(!darkMode)}
           >
            {darkMode ? <WbSunnyIcon/> : <Brightness3Icon />}
          </IconButton>

          {
            loggedIn 
            && <>
                <IconButton 
                  color="secondary"
                  onClick={(e)=> setOpenMenu(true)}
                >
                 <EditIcon />
                </IconButton>
                <IconButton 
                  color="secondary"
                  onClick={(e)=> handleLogout(e)}
                >
                  <ExitToAppIcon />
                </IconButton>

            </>
          }

        </div>
      </Toolbar>
      <EditMenu 
        openMenu={openMenu} 
        setOpenMenu={setOpenMenu}
        className={cl}
      />
    </AppBar>

  )
}

export default Header
